import React from 'react';
import { Card, Button } from 'antd';
import CardItemContent from '../card-item-content/card-item-content.component';

const { Meta } = Card;

const CardItem = () => (
  <Card
    hoverable
    style={{ width: 360 }}
    cover={(
      <img
        alt="example"
        style={{ width: '100%' }}
        src="https://i.pinimg.com/736x/26/58/b1/2658b16da86d5427f65ad2476739734b.jpg"
      />
    )}
    actions={[
      <Button key="submit" type="primary">
        Add To Card
      </Button>,
      <Button key="submit" type="secondary">
        More Detail
      </Button>,
    ]}
  >
    <Meta
      title="Europe Street beat"
      description={
        <CardItemContent />
      }
    />
  </Card>
);

export default CardItem;
